import { useLocation } from "react-router-dom";
import {useEffect} from "react";

function Nav() {
    useEffect(() => {
        const url = useLocation()
    }, [url]);

    return(
        <header>
            <div></div>
            <nav></nav>

        </header>
    )
}

export default Nav;
